import React, {Component} from "react";
import {Messages} from "primereact/messages";
import {Card} from "primereact/card";
import {InputText} from "primereact/inputtext";
import {classNames} from "primereact/utils";
import {Button} from "primereact/button";

export class User extends Component {

    constructor(props) {
        super(props);
        this.state = {
            user:'',
            submitted:''
        }
    }


    render() {

        return (
            <div style={{width:'80%', margin:'0 auto', marginTop:'40px'}}>
                <Messages ref={el => (this.messages = el)} />
                <Card title="Register" footer={this.footerCard}>
                    <div className="col-12 md:col-4">
                        <label htmlFor="name">Name</label>
                        <div className="p-inputgroup">
                            <InputText id="name"
                                       onChange={(e) => this.onInputChange(e)}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                        </div>
                        <label htmlFor="midName">Middle Name</label>
                        <div className="p-inputgroup">
                            <InputText id="midName"
                                       onChange={(e) => this.onInputChange(e)}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                        </div>
                        <label htmlFor="lastName">Last Name</label>
                        <div className="p-inputgroup">
                            <InputText id="lastName"
                                       onChange={(e) => this.onInputChange(e)}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                        </div>
                        <label htmlFor="Email">Email</label>
                        <div className="p-inputgroup">
                            <InputText id="Email"
                                       onChange={(e) => this.onInputChange(e)}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                        </div>
                        <label htmlFor="Phone">Phone</label>
                        <div className="p-inputgroup">
                            <InputText id="Phone"
                                       onChange={(e) => this.onInputChange(e)}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default User;
